import React, { useState } from "react";
import axios from "axios";

const UreaFillingVF1Form = () => {
  const [formData, setFormData] = useState({
    VC_No: "",
    VIN_No: "",
    Set_Quantity: "",
    Actual_Quantity: "",
    Set_Process_Time: "",
    Actual_Process_Time: "",
    Result: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:5000/urea-filling-vf1", formData);
      alert("✅ Data submitted successfully!");
      setFormData({
        VC_No: "",
        VIN_No: "",
        Set_Quantity: "",
        Actual_Quantity: "",
        Set_Process_Time: "",
        Actual_Process_Time: "",
        Result: "",
      });
    } catch (err) {
      console.error("Submission error:", err);
      alert("❌ Submission failed!");
    }
  };

  const styles = {
    container: {
      maxWidth: "600px",
      margin: "30px auto",
      padding: "20px",
      border: "1px solid #ccc",
      borderRadius: "10px",
      boxShadow: "0 4px 10px rgba(0,0,0,0.1)",
      backgroundColor: "#fdfdfd",
      fontFamily: "Arial, sans-serif",
    },
    heading: {
      textAlign: "center",
      marginBottom: "20px",
      fontSize: "20px",
      fontWeight: "bold",
    },
    formGroup: {
      marginBottom: "15px",
    },
    label: {
      display: "block",
      marginBottom: "5px",
      fontWeight: "bold",
    },
    input: {
      width: "100%",
      padding: "8px",
      borderRadius: "5px",
      border: "1px solid #ccc",
    },
    button: {
      marginTop: "20px",
      padding: "10px 20px",
      backgroundColor: "#007bff",
      color: "#fff",
      border: "none",
      borderRadius: "5px",
      cursor: "pointer",
      width: "100%",
    },
  };

  return (
    <div style={styles.container}>
      <div style={styles.heading}>VF1 - Urea Filling Form</div>
      <form onSubmit={handleSubmit}>
        <div style={styles.formGroup}>
          <label style={styles.label}>VC No</label>
          <input
            type="text"
            name="VC_No"
            value={formData.VC_No}
            onChange={handleChange}
            style={styles.input}
            required
          />
        </div>
        <div style={styles.formGroup}>
          <label style={styles.label}>VIN No</label>
          <input
            type="text"
            name="VIN_No"
            value={formData.VIN_No}
            onChange={handleChange}
            style={styles.input}
            required
          />
        </div>
        <div style={styles.formGroup}>
          <label style={styles.label}>Set Quantity</label>
          <input
            type="number"
            name="Set_Quantity"
            value={formData.Set_Quantity}
            onChange={handleChange}
            style={styles.input}
            required
          />
        </div>
        <div style={styles.formGroup}>
          <label style={styles.label}>Actual Quantity</label>
          <input
            type="number"
            name="Actual_Quantity"
            value={formData.Actual_Quantity}
            onChange={handleChange}
            style={styles.input}
            required
          />
        </div>
        <div style={styles.formGroup}>
          <label style={styles.label}>Set Process Time (sec)</label>
          <input
            type="number"
            name="Set_Process_Time"
            value={formData.Set_Process_Time}
            onChange={handleChange}
            style={styles.input}
            required
          />
        </div>
        <div style={styles.formGroup}>
          <label style={styles.label}>Actual Process Time (sec)</label>
          <input
            type="number"
            name="Actual_Process_Time"
            value={formData.Actual_Process_Time}
            onChange={handleChange}
            style={styles.input}
            required
          />
        </div>
        <div style={styles.formGroup}>
          <label style={styles.label}>Result</label>
          <input
            type="text"
            name="Result"
            value={formData.Result}
            onChange={handleChange}
            style={styles.input}
            required
          />
        </div>
        <button type="submit" style={styles.button}>
          Submit
        </button>
      </form>
    </div>
  );
};

export default UreaFillingVF1Form;
